import React from "react";
import CsvGraphPlotter from "./CsvGraphPlotter"; // Import the graph plotting component

function App() {
  return (
    <div>
      <header style={{ textAlign: "center", padding: "20px", background: "#f5f5f5" }}>
        <h1>Sensorless Sensing App</h1>
      </header>
      <main>
        {/* Render the CsvGraphPlotter Component */}
        <CsvGraphPlotter />
      </main>
    </div>
  );
}

export default App;
